window.bookSummaryJSON = "<p><b><i>Elle</i></b><br> He rescued me from certain death but refused to reveal his identity to me.<br> <br> He told me he’s been watching me for years.<br> <br> I should be scared.<br> But for some crazy reason, I trust him.<br> <br> He’s in my room while I sleep, protecting me,<br> But I crave more.<br> I beg him until he gives me what I want.<br> <br> Yet he still refuses to show me who he is.<br> <br> He’s intoxicating.<br> I can’t breathe without him.<br> <br> But he’s hiding something from me.<br> <br> Even when I discover the truth,<br> I can’t keep away.<br> And then I learn that I’m pregnant.<br> <br> <b><i>Lev</i></b><br> I need to keep my distance.<br> <br> She's better off without me.<br> <br> But she keeps forcing me closer.<br> <br> She thinks she knows the truth.<br> <br> But there’s so much more that I’m keeping from her.<br> <br> She has no idea the danger she’s in,<br> or who I really am.<br> I’ll do anything to protect her,<br> because without her, I’m nothing.</p>"; 
